replies:
Around 1 out of every 6 people who gets COVID-19 becomes seriously ill and develops difficulty breathing. 
#LetsFightCorona @MenPk1
@TeamForPakistan Older people, and those with underlying medical problems like high blood pressure, heart problems or diabetes, are more likely to develop serious illness.
#LetsFightCorona @MenPk1
@TeamForPakistan Other people then catch COVID-19 by touching these objects or surfaces, then touching their eyes, nose or mouth.
#LetsFightCorona @MenPk1
@TeamForPakistan These droplets land on objects and surfaces around the person. 
#LetsFightCorona @MenPk1
@TeamForPakistan This is why it is important to stay more than 1 meter (3 feet) away from a person who is sick.
#LetsFightCorona @MenPk1
@TeamForPakistan People can also catch COVID-19 if they breathe in droplets from a person with COVID-19 who coughs out or exhales droplets.
#LetsFightCorona @MenPk1
@TeamForPakistan WHO is assessing ongoing research on the ways COVID-19 is spread and will continue to share updated findings.    
#LetsFightCorona @MenPk1
@TeamForPakistan Can CoVID-19 be caught from a person who has no symptoms?
#LetsFightCorona @MenPk1
@TeamForPakistan Studies to date suggest that the virus that causes COVID-19 is mainly transmitted through contact with respiratory droplets rather than through the air.  See previous answer on “How does COVID-19 spread?”
#LetsFightCorona @MenPk1
@TeamForPakistan The risk of catching COVID-19 from someone with no symptoms at all is very low.
#LetsFightCorona @MenPk1
@TeamForPakistan The main way the disease spreads is through respiratory droplets expelled by someone who is coughing.
#LetsFightCorona @MenPk1
